import React, { Component } from "react";
import { BrowserRouter, Routes, Route } from "react-router-dom";
import Home from "./components/Home";
import About from "./components/About";
import SignIn from "./components/SignIn";
import SignUp from "./components/SignUp";
import Forgot from "./components/Forgot";
import Create from "./components/Create";
import Schedule from "./components/Schedule";
import MeetingHistory from "./components/MeetingHistory";
import ResetPasscode from "./components/ResetPasscode";
import NewPassword from "./components/NewPassword";
import UserStatus from "./components/"

export default class App extends Component {
  render() {
    return (
      <div>
        <BrowserRouter>
          <Routes>
            <Route path="/" element={<Home></Home>} />
            <Route path="home" element={<Home></Home>}></Route>
            <Route path="about" element={<About></About>}></Route>
            <Route path="login" element={<SignIn></SignIn>}></Route>
            <Route path="signup" element={<SignUp></SignUp>}></Route>
            <Route path="forgot" element={<Forgot></Forgot>}></Route>
            <Route
              path="reset"
              element={<ResetPasscode></ResetPasscode>}
            ></Route>
            <Route path="new" element={<NewPassword></NewPassword>}></Route>
            <Route path="create" element={<Create></Create>}></Route>
            <Route path="schedule" element={<Schedule></Schedule>}></Route>
            <Route
              path="history"
              element={<MeetingHistory></MeetingHistory>}
            ></Route>
            <Route path="status" element={<UserStatus></UserStatus>}></Route>
          </Routes>
        </BrowserRouter>
      </div>
    );
  }
}
